import Movies from "../Movies/Movies";
import HomeFooter from "./HomeFooter";
import HomeHeader from "./HomeHeader";

const Home = props => {
    return(
        <div>
            <CartProvider>
                {cartIsShown && <Cart onClose={hideCartHandler} />}
                <Header onShowCart={showCartHandler} />
                <main>
                    <Meals />
                </main>
            </CartProvider>
            <HomeHeader />
            <Movies data={props.data}/>
            <HomeFooter />
        </div>
    );
};

export default Home;
